Also purged: the &quot;surprise&quot; they keep bitching about. It was a male hooker giving the (un)lucky girl a lap-dance (why they couldn't just hire a superhot chick is beyond me). GIRLSONLYPLEASE! They reminisce about this later on, if you're bothering to follow the chatter.

English subtitles are hardcoded into my source material so sorry, you have to put up with the amusingly bad translations distracting you from the girl-on-girl action.

